import React from 'react'
import { Container, Img, Logo } from './Navbar.styled'

const Navbar = () => {
  return (
    <Container>
        <Logo><Img src="https://blackhillsballoons.com/wp-content/uploads/2021/01/Instagram-Logo.png" alt="logo" /></Logo>
    </Container>
  )
}

export default Navbar
